// src/pages/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './AdminDashboard.css';
import AdminNavbar from '../components/AdminNavbar';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('upload');
  const [mobiles, setMobiles] = useState([]);
  const [form, setForm] = useState({
    brand: '', model: '', ram: '', storage: '', price: '', condition: ''
  });
  const [image, setImage] = useState(null);
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) {
      navigate('/login');
      return;
    }
    fetchMobiles();
  }, [token, navigate]);

  const fetchMobiles = async () => {
    try {
      const res = await axios.get('/api/mobiles', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(res.data);
    } catch (err) {
      console.error('Fetch error:', err);
    }
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    const data = new FormData();
    Object.entries(form).forEach(([key, value]) => data.append(key, value));
    data.append('image', image);

    try {
      await axios.post('/api/mobiles/upload', data, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`
        }
      });
      alert('‚úÖ Uploaded successfully!');
      setForm({ brand: '', model: '', ram: '', storage: '', price: '', condition: '' });
      setImage(null);
      fetchMobiles();
    } catch (err) {
      console.error('Upload failed:', err);
      alert('‚ùå Upload failed');
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Are you sure you want to delete this mobile?')) return;
    try {
      await axios.delete(`/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles((prev) => prev.filter((m) => m._id !== id));
    } catch (err) {
      console.error('Delete failed:', err);
      alert('‚ùå Delete failed');
    }
  };

  return (
    <div className="admin-dashboard">
      <AdminNavbar activeTab={activeTab} setActiveTab={setActiveTab} />

      {activeTab === 'upload' && (
        <form className="upload-form" onSubmit={handleUpload}>
          <h2>üì§ Upload New Mobile</h2>
          <input type="text" placeholder="Brand" value={form.brand} onChange={(e) => setForm({ ...form, brand: e.target.value })} required />
          <input type="text" placeholder="Model" value={form.model} onChange={(e) => setForm({ ...form, model: e.target.value })} required />
          <input type="text" placeholder="RAM" value={form.ram} onChange={(e) => setForm({ ...form, ram: e.target.value })} required />
          <input type="text" placeholder="Storage" value={form.storage} onChange={(e) => setForm({ ...form, storage: e.target.value })} required />
          <input type="number" placeholder="Price" value={form.price} onChange={(e) => setForm({ ...form, price: e.target.value })} required />
          <input type="text" placeholder="Condition" value={form.condition} onChange={(e) => setForm({ ...form, condition: e.target.value })} required />
          <input type="file" onChange={(e) => setImage(e.target.files[0])} required />
          <button type="submit">Upload</button>
        </form>
      )}

      {activeTab === 'manage' && (
        <div className="mobile-list">
          <h2>üì± Uploaded Mobiles</h2>
          {mobiles.length === 0 ? (
            <p>No mobiles found.</p>
          ) : (
            <div className="mobile-grid">
              {mobiles.map((mobile) => (
                <div key={mobile._id} className="mobile-card">
                  <img src={mobile.imageUrl} alt={mobile.model} />
                  <h3>{mobile.brand} - {mobile.model}</h3>
                  <p>{mobile.ram} / {mobile.storage}</p>
                  <p>‚Çπ{mobile.price} - {mobile.condition}</p>
                  <button onClick={() => handleDelete(mobile._id)}>üóëÔ∏è Delete</button>
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
